import React from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

export default function TeamComp({ teams }) {
  console.log(teams);

  return (
    <div>
      <Link>
        {teams.map((team, i) => {
          return <p key={i}>{team.name}</p>;
        })}
      </Link>
    </div>
  );
}
